import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';


class Todo extends Component {

    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div className='row p-xl-5'>
                <div className='col-md-3'/>
                <div className='card col-md-6 p-xl-5'>
                    <div className='card-header d-flex justify-content-between pb-2'>
                        <h4 className='d-inline'>School</h4>
                        <i className='far fa-trash-alt' style={{cursor: 'pointer'}}/>
                    </div>

                </div>
            </div>
        );
    }

}

export default Todo;
